import React from "react";
import logo from "../images/aranyagiri1.png";

const Header = () =>
{
    return(
        
            <div className= "ui segment">
                <div className="ui four column doubling stackable grid container">
                <div class="column">
                    <img className="ui left floated small image" src={logo} alt="Header"/>  
                </div>

                <div class="column">
                    <h1 class="ui center aligned icon header"
                        style={{color:"red"}} >        
                            अरण्यगिरी फार्म हाऊस
                    </h1>   
                </div>
                <div class="column">
                    <button class="medium ui button">
                         Bookings
                    </button>
                </div>
             
                                      
                </div>
            </div>
    );
};

export default Header;
